import React, { Component } from "react";

import HomePage from "./pages/HomePage";
import AboutPage from "./pages/AboutPage";
import ArticleList from "./pages/ArticleList";
import ArticlePage from "./pages/ArticlePage";

import "./App.css";

function App() {
  return (
    <div className="App">
      <HomePage />
      <AboutPage />
    </div>
  );
}

export default App;
